import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the price filter section using its heading text (different selector strategy)
    await page.waitForSelector('text=Price Range', { timeout: 5000 });

    // Locate the min and max price inputs using placeholder attribute
    const minInput = await page.waitForSelector('input[placeholder="Min"]', { timeout: 5000 });
    const maxInput = await page.waitForSelector('input[placeholder="Max"]', { timeout: 5000 });

    // Clear and enter new values for min and max price
    await minInput.fill('');
    await minInput.type('100');
    await maxInput.fill('');
    await maxInput.type('500');

    // Screenshot after entering price values
    const step2 = path.join(screenshotsDir, 'step_2_price_entered.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Locate and click the Apply button using its visible text (alternative selector)
    const applyBtn = await page.waitForSelector('button:has-text("Apply")', { timeout: 5000 });
    await applyBtn.click();

    // Wait for the filter to apply (look for notification or UI update)
    // We'll wait for a notification with text "Applied price filter"
    await page.waitForSelector('text=Applied price filter', { timeout: 5000 });

    // Screenshot after filter applied
    const step3 = path.join(screenshotsDir, 'step_3_filter_applied.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the current min and max price values to verify
    const minPriceValue = await page.$eval('input[placeholder="Min"]', el => el.value);
    const maxPriceValue = await page.$eval('input[placeholder="Max"]', el => el.value);

    // Optionally, extract the number of products shown (if available)
    let resultsCount = null;
    const resultsCountEl = await page.$('.results-count');
    if (resultsCountEl) {
      resultsCount = await resultsCountEl.innerText();
    }

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and verified UI update",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue,
        resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
